import React, { Component } from 'react';
import { Navbar, Nav } from "../../node_modules/react-bootstrap";
import Bonds from "../components/index";

class Navigation extends Component {
    state = {}
    render() {
        return (
            <React.Fragment>
                <Navbar defaultActiveKey="eval" bg="dark" variant="dark">
                    <Navbar.Brand>BOND PRICING</Navbar.Brand>
                    <Nav.Link href="">INSTRUCTIONS</Nav.Link>
                    <Nav.Link key="eval" href="index">EVALUATE</Nav.Link>
                </Navbar>
                <Bonds />
            </React.Fragment>
        )
    }
}

export default Navigation;
